    public int lengthOfLongestSubstring(String s) {
        int longest = 0;
        int currentHeadIndex = 0;
        HashMap<Character, Integer> indexMap = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            Integer charIndex = indexMap.get(c); // O(1)
            if (charIndex != null && charIndex >= currentHeadIndex) {
                if (i - currentHeadIndex > longest) {
                    longest = i - currentHeadIndex;
                }
                currentHeadIndex = charIndex + 1;
            }
            indexMap.put(c, i); // this will replace the old value
        }
        if (s.length() - currentHeadIndex > longest) {
            longest = s.length() - currentHeadIndex;
        }
        return longest;
    }
